import React, { Component } from "react";
import Plans from '../Plans';
import DDD from '../DDD';
import Time from '../Time';


class Table extends Component {

  getDDDOptions = () => ['011', '016', '017', '018'].map(ddd => <option value={ddd}>{ddd}</option>)

  render() {
    return (
      <table>
        <tr>
          <th>DDD Origem</th>
          <th>DDD Destino</th>
          <th>Plano FaleMais</th>
          <th>Tempo em minutos</th>
          <th>Valor sem FaleMais</th>
          <th>Valor com FaleMais</th>
        </tr>
        <tr>
          <td> <select class="DDD">{this.getDDDOptions()}</select></td>
          <td> <select class="DDD"></select></td>
          <td> <select class="Plans"></select></td>
          <td> <select class="Time"></select></td>
          <td> <select class="NoPlan"></select></td>
          <td> <select class="WithPlan"></select></td>
        </tr>
      </table>
    );
  }
}

export default Table;
